import './App.css';
import myImg from './myimg.png'

function App() {
  return (
    <div style={{backgroundColor:"#5B9BD5",width:"100%",height:"1000px"}}>
      <div>

          <img src={myImg}/>
      </div>

    </div>
  );
}

export default App;
